  [],\n\t\"revision_timestamp\": \"2015-08-21T22:50:23.763481\",\n\t\"name\": \"transient-cold-climate-building-foundation-hygrothermal-experimental-data\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The data consist of two years of continuous
  transient experimental measurements on the hygrothermal performance of concrete
  masonry block walls in a full basement in a cold climate (US DOE climate zone 7).
  The walls were insulated in compliance with the thermal requirements of the 2012
  International Energy Conservation Code and in compliance with the durability performance
  requirements of the 2009 MN Building Code. These data are useful for verifying the
  physical validity of cold-climate foundation insulation system building code requirements;
  understanding the physics of heat and moisture transport in foundation walls from
  an experimental perspective; and, validating the predictions of thermal and hygrothermal
  building foundation simulation programs. The data are in the public domain and can
  be released now since the peer-review process has been completed.\",\n\t\"license_title\":
